'    and t2.state_code in (''UNASSIGNED'',''ASSIGNED'')',
'   left outer join EBA_DEMO_APPR_LAPTOP_REQUESTS R ',
'    on r.empno = e.empno and (r.status = ''PENDING'' or (r.status = ''APPROVED'' and r.delivered_date is null))',
